// OrdersComponent.js

import React, { useState, useEffect } from 'react';

const LiveOrdersComponent = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {

    const userInfo = {
      userId: 999999,
      password: "abc", // Caution with sensitive info
      groupNum: 0
    };


    fetch('/api/get-closed-trades', {
      method: 'POST', // Or 'PUT', depending on your API endpoint requirements
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(userInfo) // Convert the JavaScript object to a JSON string
    })
    .then(response => response.json())
    .then(data => setClosedTrades(data))
    .catch(error => console.error('Error fetching closed trades:', error));
  }, []);

  return (
    <div>
      <h2>Orders</h2>
      <ul>
        {orders.map(order => (
          <li key={order.id}>
            Order ID: {order.id}, Status: {order.status}, Quantity: {order.quantity}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default LiveOrdersComponent;
